SELECT "Rentabilidad_1"."Población Distribuidor GVF/GVI" AS "Población Distribuidor GVF/GVI",   ((CAST((CAST(SUM("Rentabilidad_1"."IN") AS double) / NULLIF(SUM("Rentabilidad_1"."CF"),0)) AS double) * CAST(cast('0.46999999999999997' as double) AS double)) - (CAST((SUM("Rentabilidad_1"."TOTAL VENTA") + SUM("Rentabilidad_1"."TOTAL REPARTO")) AS double) / NULLIF(SUM("Rentabilidad_1"."CF"),0))) AS "usr:Calculation_2160818191446896:ok" FROM "Rentabilidad_1" WHERE (("Rentabilidad_1"."Sede Foraneo Sintec" = 'Foraneo') AND ("Rentabilidad_1"."Zona" = 'NR')) GROUP BY "Rentabilidad_1"."Población Distribuidor GVF/GVI";
